export default function CreateBreed() {
    function handleSubmit(event) {
      event.preventDefault();
  
      if (validateForm()) {
        // Aquí puedes enviar el formulario
      }
    }
  
    return (
      <>
        <form onSubmit={handleSubmit}>
          <div>
            <label htmlFor="name">Nombre:</label>
            <input type="text" id="name" name="name" required />
  
            <label htmlFor="min-height">Altura mínima (cm):</label>
            <input type="number" id="min-height" name="min-height" required />
  
            <label htmlFor="max-height">Altura máxima (cm):</label>
            <input type="number" id="max-height" name="max-height" required />
  
            <label htmlFor="min-weight">Peso mínimo (kg):</label>
            <input type="number" id="min-weight" name="min-weight" required />
  
            <label htmlFor="max-weight">Peso máximo (kg):</label>
            <input type="number" id="max-weight" name="max-weight" required />
  
            <label htmlFor="lifespan">Años de vida:</label>
            <input type="number" id="lifespan" name="lifespan" required />
  
            <label htmlFor="temperaments">Temperamentos:</label>
            <select id="temperaments" name="temperaments" multiple>
              <option value="amigable">Amigable</option>
              <option value="jugueton">Juguetón</option>
              <option value="inteligente">Inteligente</option>
              <option value="protector">Protector</option>
            </select>
  
            <button type="submit">Crear nueva raza</button>
          </div>
        </form>
      </>
    );
  }
